* *Endpoint*: {{/api/users}}
* *Method*: {{POST}}
* *Description*: Registers a new user in the system.
*Request Body*
* {
  "username": "johndoe",
  "email": "[john@example.com|mailto:john@example.com]",
  "password": "password123"
}

*Response*
{
  "message": "User created successfully",
  "user": {
    "id": 1,
    "username": "johndoe",
    "email": "[john@example.com|mailto:john@example.com]"
  }
}

