28/Sep/24 9:53 AM;712020:d529e9b4-f98d-41ca-884d-3af31fc7e839;h3. API Integration with Frontend in Course Management

# *API Endpoints*:

* *GET /courses*: Retrieve a list of courses.
* *POST /courses*: Add a new course.
* *GET /courses/{id}*: Retrieve course details.
* *PUT /courses/{id}*: Update course information.
* *DELETE /courses/{id}*: Remove a course.
*Frontend Implementation*:
** Use a framework like React, Angular, or Vue.js for the frontend.
** Utilize {{fetch}} or libraries like Axios for making API calls


** *Example using React with Axios*:
import React, { useState, useEffect } from 'react';
import axios from 'axios';

const CourseList = () => {
    const [courses, setCourses] = useState([]);

{noformat}useEffect(() => {
    const fetchCourses = async () => {
        try {
            const response = await axios.get('/api/courses');
            setCourses(response.data);
        } catch (error) {
            console.error('Error fetching courses:', error);
        }
    };

    fetchCourses();
}, []);

return (
    <div>
        <h1>Course List</h1>
        <ul>
            {courses.map(course => (
                <li key={course.id}>{course.title}</li>
            ))}
        </ul>
    </div>
);{noformat}

};

export default CourseList;

28/Sep/24 10:04 AM;712020:19801315-4e26-4e83-8396-5808470fe500;# Setting Up Your Testing Environment
Choose a testing framework suitable for your project, such as:

Jest: A popular JavaScript testing framework.
Mocha: A flexible testing framework often used with Chai for assertions.
React Testing Library: Great for testing React components.

# Writing Unit Tests
Here's a basic example of how to write unit tests for a React component using Jest and React Testing Library.

TEXT EXAPMLE

// Button.test.js
import React from 'react';
import { render, fireEvent } from '@testing-library/react';
import Button from './Button';

test('renders button with label', () => {
    const { getByText } = render(<Button label="Click Me" />);
    const buttonElement = getByText(/click me/i);
    expect(buttonElement).toBeInTheDocument();
});

test('calls onClick handler when clicked', () => {
    const handleClick = jest.fn();
    const { getByText } = render(<Button label="Click Me" onClick={handleClick} />);
    const buttonElement = getByText(/click me/i);
    fireEvent.click(buttonElement);
    expect(handleClick).toHaveBeenCalledTimes(1);
});
